import React, { Component } from "react";

class App extends Component {
	

	render() {
		return (
			<React.Fragment>
				<h1>Hello World</h1>
				<h2>This is the list of all the animals</h2>
				<ul>{/* <li>venu</li>
					<li>manohar</li>
					<li>sirpuram</li> */}</ul>
			</React.Fragment>
		);
	}
}

export default App;
